import{newSpecPage}from"@stencil/core/testing";import{PrestoVideo}from"../presto-video";describe("presto-video",(()=>{it("renders",(async()=>{const e=await newSpecPage({components:[PrestoVideo],html:'<presto-video src="https://example.com/test.mp4"></presto-video>'});expect(e.root).toEqualHtml('\n    <presto-video src="https://example.com/test.mp4">\n      <video class="presto-player__player" part="video">\n        <source src="https://example.com/test.mp4">\n      </video>\n    </presto-video>\n    ')}))}));